import ReactDOM from "react-dom/client";
import React from "react";

function Home() {
  return (
    <div className="carousel rounded-box">
      <div>
        <img src="https://placeimg.com/400/300/arch" alt="Burger" />
      </div>
      <div className="carousel-item">
        <img src="https://placeimg.com/400/300/arch" alt="Burger" />
      </div>
    </div>
  );
}

export default Home;
